import React from 'react';

const NewsList = (props) => {
    const items = props.news.map((item) => {
        return(
            <div>
                <h3>{item.title}</h3>
                <div>
                    {item.content}
                </div>
            </div>
        )
    });
    return (
        <div>
            <p>{items}</p>
        </div>
    )
}

export default NewsList;
